ht.columns.drawCell:
__ht__function(g, text, rect, option) {
            var font = option.font,
                color = option.color,
                x = rect.x,
                y = rect.y,
                width = rect.width,
                height = rect.height,
                defaultDraw = option.defaultDraw,
                newColor = 'rgb(237, 194, 21)'
            if (
                text.indexOf('异常') > -1
                 ||
                text.indexOf('偏高') > -1
                 ||
                text.indexOf('偏移') > -1
                 ||
                text.indexOf('过大') > -1
                 ||
                text.indexOf('过多') > -1
                 ||
                text.indexOf('不足') > -1
            ) {
                ht.Default.drawText(g, text, font, newColor, x, y, width, height, 'left', 'middle');
            } else {
                ht.Default.drawText(g, text, font, color, x, y, width, height, 'left', 'middle');
            }
        }

